// Home.js
import React from "react";
import Logo from "../elements/logo/Logo";
import Sides from "../elements/Sides";
import "../elements/Sides.css"; // Import the CSS file for Sides
import "./home.css";
import admin from "../asstes/admin.png";
import staff from "../asstes/staff.png";
import homeside from "../asstes/home.png";

const Home = () => {
  return (
    <div className="home">
      <div>
        <Logo />
      </div>
      <div className="home-container">
        <Sides source={homeside} />
        <div className="container">
          <div className="who">
            <p>Who are You??</p>
          </div>
          <div className="logins">
            <div className="admin">
              <div className="adminimg">
                <img src={admin} alt="admin" />
              </div>
              <p>ADMIN</p>
            </div>
            <div className="staff">
              <div className="staffimg">
                <img src={staff} alt="staff" />
              </div>
              <p>STAFF</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
